import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import './App.css';

// Import your components
import Navigation from './Navigation'; // Assuming you've named your component file Navigation.js
import { navItems } from './NavItems'; // Assuming you've named your data file NavItems.js

const App = () => {
  return (
    <Router>
      <Navigation navItems={navItems} />
    </Router>
  );
};

export default App;
